import React from "react";
import "./index.css";

const AboutUs = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <img
        className="img"
        src="https://www.harbingergroup.com/wp-content/uploads/2023/05/blog.webp"
        alt="aboutus"
      />
      <p>
        At Genimix, we're driven by a passion for harnessing the incredible
        potential of artificial intelligence to empower individuals and
        businesses alike. Our journey began with a vision: to create a platform
        that seamlessly merges the world of AI with your creative and practical
        needs. We are proud to introduce you to a suite of AI applications that
        are designed to simplify your life and elevate your experiences.
      </p>
    </div>
  );
};

export default AboutUs;
